import React from "react";
import { useSelector } from "react-redux";
import { selectQuizzes } from "./quizzesSlice"; // Import the selector

export default function Quizzes() {
  const quizzes = useSelector(selectQuizzes); // Use the selector to get quizzes

  return (
    <div>
      <h1>Quizzes</h1>
      {quizzes.map((quiz) => (
        <div key={quiz.id}>
          <h2>{quiz.name}</h2>
          {/* Render other quiz details here */}
        </div>
      ))}
    </div>
  );
}
